import { GET_STADIUMS } from "./actionTypes";
import axios from "axios";

export const getStadiums = () => async (dispatch) => {
  try {
    const res = axios.get("/api/stadium");
    dispatch({
      type: GET_STADIUMS,
      payload: res.data,
    });
    console.log(res.data);
  } catch (err) {
    console.log(err.message);
  }
};
